import React, { Component } from 'react'
import './sidenav.css'
// const go = {
//     transform: "rotate(90deg)",
//     marginRight: "8px",

//     marginTop: "17px"
// }
class SideNav extends Component {
    constructor() {
        super()
        this.state = {
            go1: false,
            go2: false,
            go3: false
        }
        this.go1 = this.go1.bind(this)
        this.go2 = this.go2.bind(this)
        this.go3 = this.go3.bind(this)
    }
    go1() {
        this.setState(prev => {
            return {
                go1: !prev.go1
            }
        })
    }
    go2() {
        this.setState(prev => {
            return {
                go2: !prev.go2
            }
        })
    }
    go3() {
        this.setState(prev => {
            return {
                go3: !prev.go3
            }
        })
    }
    close = () => {
    }
    render() {
        return (
            <>
                <div className="sie"
                    onClick={() => {
                        this.props.class()
                    }}
